INSERT INTO `berita` (`id`, `kategori_berita`, `judul`, `slug`, `gambar`, `isi`, `create_by`, `create_at`, `update_by`, `update_at`) VALUES
(1, 3, 'Why every startup should adopt Amazon’s Hot Air.', 'why-every-startup-should-adopt-amazons-hot-air', '611650bfa5db4.png', '<p style=\"text-align: justify;\">It is used every day in all types of businesses; Email newsletters, websites, print and online advertisements, presentations, social media updates, flyers, and brochures; the list goes on and on</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://localhost:8080/member_event_lpkn/uploads/news/tiny/WhatsApp-Image-2021-07-22-at-15_46_45.jpg\" alt=\"\" width=\"749\" height=\"421\" /></p>\r\n<p style=\"text-align: justify;\">David Ogilvy, the advertising legend once said that, On average, five times as many people read the headline as read the body copy. When you have written your headline, you have spent eighty cents out of your dollar.\" As Ogilvy points out, your headline is the first (and sometimes the only) thing that your audience will read.</p>\r\n<p style=\"text-align: justify;\">You just need to enter the keyword and select the keyword type to generate a list of 6 title ideas and suggestions. If you&rsquo;re not satisfied with the results, you can always hit the refresh button to generate a new list of unique titles.</p>\r\n<p style=\"text-align: justify;\">Once you&rsquo;ve gotten all the titles and have chosen the best one, the next thing you need to do is to craft a magnetic content. Great content marketers excel at creating content that their readers crave, but even the best struggle with delivering content to the right person at the right time.</p>', 1, '2021-08-13 11:25:14', 1, '2022-07-20 19:13:32'),
(2, 1, 'Why every startup should adopt Amazon’s Hot Air. test', 'why-every-startup-should-adopt-amazons-hot-air-test', '611662a74f0e6.jpeg', '<p>It is used every day in all types of businesses; Email newsletters, websites, print and online advertisements, presentations, social media updates, flyers, and brochures; the list goes on and on</p>\r\n<p>David Ogilvy, the advertising legend once said that, On average, five times as many people read the headline as read the body copy. When you have written your headline, you have spent eighty cents out of your dollar.\" As Ogilvy points out, your headline is the first (and sometimes the only) thing that your audience will read.</p>\r\n<p>You just need to enter the keyword and select the keyword type to generate a list of 6 title ideas and suggestions. If you’re not satisfied with the results, you can always hit the refresh button to generate a new list of unique titles.</p>\r\n<p>Once you’ve gotten all the titles and have chosen the best one, the next thing you need to do is to craft a magnetic content. Great content marketers excel at creating content that their readers crave, but even the best struggle with delivering content to the right person at the right time.</p>\r\n<div class=\"ttr-divider bg-gray\"> </div>', 1, '2021-08-13 14:16:39', 1, '2021-08-13 14:33:11'),
(3, 2, 'What Will Education Be Like In The Next 50 Years?', 'what-will-education-be-like-in-the-next-50-years', '6116675a0ca50.jpeg', '<p style=\"text-align: justify;\">It is used every day in all types of businesses; Email newsletters, websites, print and online advertisements, presentations, social media updates, flyers, and brochures; the list goes on and on</p>\r\n<p style=\"text-align: justify;\">David Ogilvy, the advertising legend once said that, On average, five times as many people read the headline as read the body copy. When you have written your headline, you have spent eighty cents out of your dollar.\" As Ogilvy points out, your headline is the first (and sometimes the only) thing that your audience will read.</p>\r\n<p style=\"text-align: justify;\">You just need to enter the keyword and select the keyword type to generate a list of 6 title ideas and suggestions. If you&rsquo;re not satisfied with the results, you can always hit the refresh button to generate a new list of unique titles.</p>\r\n<p style=\"text-align: justify;\">Once you&rsquo;ve gotten all the titles and have chosen the best one, the next thing you need to do is to craft a magnetic content. Great content marketers excel at creating content that their readers crave, but even the best struggle with delivering content to the right person at the right time.</p>', 1, '2021-08-13 14:18:46', 1, '2022-08-03 15:12:06');
